import React from 'react';

import ReportComponent from '../ReportComponent/ReportComponent';

export default function(props){
    return (
        <div >
            {
                props.list.map((i) => {
                    return <ReportComponent key={i.id} report={i}/>
                })
            }
        </div>
    );
}

